import { useState } from 'react';
import './App.css';

function LoginForm() {

    const [val,setval] = useState(); 
    const [fulname,setFulname] = useState(); 


   function onChangeFunction(event){
     let userName = event.target.value;
     setval(userName);
   }

   function onSubmitFunction(e){
    e.preventDefault();
     setFulname(val);
   }

    return(
        <>
         <div className='formIntroBody'>
            <h1>Login Form in React</h1>
            <form onSubmit={onSubmitFunction}>
            <h2>Hello {fulname}</h2>
            <input type='text' placeholder='Enter Your First Name' value={val} onChange={onChangeFunction} />
            <input type='text' placeholder='Enter Your Last Name' value={val} onChange={onChangeFunction} />

            <br />
            <button>Click me</button>
            </form>
         </div>
        </>
    )
}

export default LoginForm;
